class User extends Component {
    render() {
        return (
            <div>
                    <span>Nome: { this.props.name }</span>
                    <br></br>
                    <span>Email: { this.props.email }</span>
                    <img src="{ this.props.photo }" />
            </div>
        )
    }
  }

  export default User;
